import React from "react";

const Footer = () => {
    return (
        <footer className="footer">
            <p>&copy; 2025 Dripper. All rights reserved.</p>
            <div className="social-links">
                <a href="#" className="social-link">
                    Instagram
                </a>
                <a href="#" className="social-link">
                    Facebook
                </a>
                <a href="#" className="social-link">
                    Twitter
                </a>
            </div>
        </footer>
    );
};

export default Footer;
